class ConstructionAxes(core.Base):
    """
    Provides access to the construction axes within a component and provides methods to create new construction axes.
    """
    def __init__(self):
        pass
    @staticmethod
    def cast(arg):
        return ConstructionAxes()
    def item(self, index):
        """
        Function that returns the specified construction axis using an index into the collection.

        index : The index of the item within the collection to return. The first item in the collection has an index of 0.

        Returns the specified item or null if an invalid index was specified.
        """
        return ConstructionAxis()
    def itemByName(self, name):
        """
        Returns the specified construction axis using the name of the construction axis as it is displayed in the browser.

        name : The name of the axis as it is displayed in the browser

        Returns the specified item or null if an invalid name was specified.
        """
        return ConstructionAxis()
    def createInput(self, occurrenceForCreation):
        """
        Create a ConstructionAxisInput object that is in turn used to create a ConstructionAxis.

        occurrenceForCreation : A creation occurrence is needed if the input is in another component AND the construction axis is not in the root component. The occurrenceForCreation is analogous to the active occurrence in the UI.

        Returns a ConstructionAxisInput object
        """
        return ConstructionAxisInput()
    def add(self, input):
        """
        Creates and adds a new ConstructionAxis using the creation parameters in the ConstructionAxisInput. If the ConstructionAxisInput was defined using the setByLine method then the add will only work in a direct edit model (do not capture design history) and will fail in a parametric model.

        input : A ConstructionAxisInput object

        Returns the newly created construction axis or null if the creation failed.
        """
        return ConstructionAxis()
    @property
    def count(self):
        """
        The number of construction axes in the collection.
        """
        return int()
    @property
    def component(self):
        """
        The component that owns this collection.
        """
        return Component()

class ConstructionAxis(core.Base):
    """
    ConstructionAxis Object
    """
    def __init__(self):
        pass
    @staticmethod
    def cast(arg):
        return ConstructionAxis()
    def deleteMe(self):
        """
        Deletes the construction axis.

        Returns a bool indicating if the delete was successful or not.
        """
        return bool()
    def createForAssemblyContext(self, occurrence):
        """
        Creates or returns a proxy for the native object - i.e. a new object that represents this object but adds the assembly context defined by the input occurrence.

        occurrence : The occurrence that defines the context to create the proxy in.

        Returns the proxy object or null if this isn't the NativeObject.
        """
        return ConstructionAxis()
    @property
    def geometry(self):
        """
        Returns an infinite line that represents the position and orientation of the construction axis. This geometry is defined in the AssemblyContext of this ConstructionAxis.
        """
        return core.InfiniteLine3D()
    @property
    def name(self):
        """
        The name of the construction axis as it is shown in the browser.
        """
        return str()
    @name.setter
    def name(self, name):
        """
        The name of the construction axis as it is shown in the browser.
        """
        pass
    @property
    def definition(self):
        """
        Returns the construction axis definition object which provides access to the information defining the construction axis.
        """
        return ConstructionAxisDefinition()
    @property
    def isParametric(self):
        """
        Indicates if this construction axis is parametric or not.
        """
        return bool()
    @property
    def isDeletable(self):
        """
        Indicates if this construction axis can be deleted. Base construction axes can not be deleted.
        """
        return bool()
    @property
    def isLightBulbOn(self):
        """
        Indicates if the light bulb (as displayed in the browser) is on. A construction axis will only be visible if it's light bulb, and that of it's containing folder and parent component/s are also on.
        """
        return bool()
    @isLightBulbOn.setter
    def isLightBulbOn(self, isLightBulbOn):
        """
        Indicates if the light bulb (as displayed in the browser) is on. A construction axis will only be visible if it's light bulb, and that of it's containing folder and parent component/s are also on.
        """
        pass
    @property
    def isVisible(self):
        """
        Gets if the construction plane is visible. This property is affected by the AssemblyContext of the construction axis.
        """
        return bool()
    @property
    def parent(self):
        """
        Returns the parent component or base feature. If both the design and the construction axis are parametric, the parent will be a component. If the design is parametric and the construction axis is not, the parent will be a base feature. If the design is not parametric the parent will be a component.
        """
        return core.Base()
    @property
    def component(self):
        """
        Returns the component this construction plane belongs to.
        """
        return Component()
    @property
    def timelineObject(self):
        """
        Returns the timeline object associated with this construction axis.
        """
        return TimelineObject()
    @property
    def assemblyContext(self):
        """
        Returns the assembly occurrence (i.e. the occurrence) of this object in an assembly. This is only valid in the case where this is acting as a proxy in an assembly. Returns null in the case where the object is not in the context of an assembly but is already the native object.
        """
        return Occurrence()
    @property
    def nativeObject(self):
        """
        The NativeObject is the object outside the context of an assembly and in the context of it's parent component. Returns null in the case where this object is not in the context of an assembly but is already the native object.
        """
        return ConstructionAxis()
    @property
    def baseFeature(self):
        """
        If this construction axis is associated with a base feature, this property will return that base feature. If it's not associated with a base feature, this property will return null.
        """
        return BaseFeature()
    @property
    def attributes(self):
        """
        Returns the collection of attributes associated with this construction axis.
        """
        return core.Attributes()
    @property
    def healthState(self):
        """
        Returns the current health state of this construction axis.
        """
        return FeatureHealthStates()
    @property
    def errorOrWarningMessage(self):
        """
        Returns the error or warning message in the case where the healthState property returns either WarningFeatureHealthState or ErrorFeatureHealthState. Otherwise this property returns an empty string.
        """
        return str()

