class Occurrence(core.Base):
    """
    Represents an occurrence of a component at any level within a subassembly.
    """
    def __init__(self):
        pass
    @staticmethod
    def cast(arg):
        return Occurrence()
    def deleteMe(self):
        """
        Deletes the occurrence from the design. If this is the last occurrence referencing a specific Component, the component is also deleted.

        Returns true if the delete was successful.
        """
        return bool()
    def createForAssemblyContext(self, occurrence):
        """
        Creates or returns a proxy for the native object - i.e. a new object that represents this object but adds the assembly context defined by the input occurrence. Fails if this object is not the NativeObject.

        occurrence : The occurrence that represents the context you want to create this proxy in.

        Returns the proxy for the occurrence in the context of the specified occurrence. Returns null if it failed.
        """
        return Occurrence()
    def activate(self):
        """
        Makes the occurrence the active edit target in the user interface. This is the same as enabling the radio button next to the occurrence in the browser.

        Returns true if the activation was successful.
        """
        return bool()
    def moveToComponent(self, targetOccurrence):
        """
        Moves this occurrence from it's current component into the component owned by the specified occurrence. This occurrence and the target occurrence must be in the same context.

        targetOccurrence : The target occurrence defines both the component and the transform to apply when moving the occurrence. The occurrence will be copied into the parent component of the target occurrence and the target occurrence also defines the transform of how the occurrence will be copied so that the occurrence maintains it's same position in model space.

        Returns the moved Occurrence or null in the case the move failed.
        """
        return Occurrence()
    def getPhysicalProperties(self, accuracy):
        """
        Returns the PhysicalProperties object that has properties for getting the area, density, mass, volume, moments, etc of this occurrence.

        accuracy : Specifies the desired level of computational accuracy of the property calculations. The default value of 'LowCalculationAccuracy' returns results within a +/- 1% error margin.
        """
        return PhysicalProperties()
    def breakLink(self):
        """
        When the component this occurrence references is an external reference (the isReferencedComponent property returns true), this will break the link and create a local Component that this occurrence will reference. The new local Component can be accessed through the Occurrence using the component property. This method will fail if the occurrence is not referencing an external component.

        Returns true if the break link was successful.
        """
        return bool()
    @property
    def sourceComponent(self):
        """
        This is the sourceComponent for the occurrence and is affected by the assembly context. This is the top-level component where the path begins.
        """
        return Component()
    @property
    def childOccurrences(self):
        """
        Returns a read only list of child occurrences where only the occurrences in this occurrence's AssemblyContext are returned .
        """
        return OccurrenceList()
    @property
    def component(self):
        """
        The component this occurrence references.
        """
        return Component()
    @property
    def name(self):
        """
        The name of the occurrence. This is the name as seen in the browser. It is a reflection of the component name with an added counter suffix (i.e. 'OccurrenceName:1').
        """
        return str()
    @property
    def fullPathName(self):
        """
        The name of the occurrence, including the full path of occurrences as seen in the browser. The top-level component will depend on the context but will typically be the root component of the design. A name for an occurrence that is at the third level of an assembly could be 'Sub1:1+Sub2:1+PartA:1'.
        """
        return str()
    @property
    def appearance(self):
        """
        Read-write property that gets and sets the appearance override for this occurrence. This property can return null indicating there is no override appearance and that the contents of the occurrence are displayed using there defined appearance. Setting the property to null will remove any override appearance for this occurrence.
        """
        return core.Appearance()
    @appearance.setter
    def appearance(self, appearance):
        """
        Read-write property that gets and sets the appearance override for this occurrence. This property can return null indicating there is no override appearance and that the contents of the occurrence are displayed using there defined appearance. Setting the property to null will remove any override appearance for this occurrence.
        """
        pass
    @property
    def isLightBulbOn(self):
        """
        Gets and sets if the light bulb of this occurrence as displayed in the browser is on or off. An occurrence will only be visible if the light bulb is switched on. However, the light bulb can be on and the occurrence still invisible if a higher level occurrence in the assembly context is not visible because its light bulb is off.
        """
        return bool()
    @isLightBulbOn.setter
    def isLightBulbOn(self, isLightBulbOn):
        """
        Gets and sets if the light bulb of this occurrence as displayed in the browser is on or off. An occurrence will only be visible if the light bulb is switched on. However, the light bulb can be on and the occurrence still invisible if a higher level occurrence in the assembly context is not visible because its light bulb is off.
        """
        pass
    @property
    def isVisible(self):
        """
        Gets whether the occurrence is visible. This property is affected by the assembly context.
        """
        return bool()
    @property
    def transform(self):
        """
        Gets and sets the 3d matrix data that defines this occurrences orientation and position in its assembly context
        """
        return core.Matrix3D()
    @transform.setter
    def transform(self, transform):
        """
        Gets and sets the 3d matrix data that defines this occurrences orientation and position in its assembly context
        """
        pass
    @property
    def timelineObject(self):
        """
        Returns the timeline object associated with the creation of this occurrence.
        """
        return TimelineObject()
    @property
    def assemblyContext(self):
        """
        Returns the assembly occurrence (i.e. the occurrence) of this object in an assembly. This is only valid in the case where this references the component the object is defined within. Returns null in the case where the object is not in the context of an assembly but is already the native object.
        """
        return Occurrence()
    @property
    def nativeObject(self):
        """
        The NativeObject is the object outside the context of an assembly. Returns null in the case where this object is not in the context of an assembly but is already the native object. The return type is strongly typed for each object.
        """
        return Occurrence()
    @property
    def isGrounded(self):
        """
        Gets and sets whether this occurrence is grounded or not.
        """
        return bool()
    @isGrounded.setter
    def isGrounded(self, isGrounded):
        """
        Gets and sets whether this occurrence is grounded or not.
        """
        pass
    @property
    def isSelectable(self):
        """
        Gets and sets whether this occurrence is selectable or not.
        """
        return bool()
    @isSelectable.setter
    def isSelectable(self, isSelectable):
        """
        Gets and sets whether this occurrence is selectable or not.
        """
        pass
    @property
    def isIsolated(self):
        """
        Gets and sets whether this occurrence is isolated in the UI. When an occurrence is isolated it is the only one visible in the user-interface. Only one occurrence can be isolated at a time so setting this property to true will unisolate an occurrence that is currently isolated. Setting this property to false for an occurrence that is current isolated will unisolate it so that no occurrence will be isolated.
        """
        return bool()
    @isIsolated.setter
    def isIsolated(self, isIsolated):
        """
        Gets and sets whether this occurrence is isolated in the UI. When an occurrence is isolated it is the only one visible in the user-interface. Only one occurrence can be isolated at a time so setting this property to true will unisolate an occurrence that is currently isolated. Setting this property to false for an occurrence that is current isolated will unisolate it so that no occurrence will be isolated.
        """
        pass
    @property
    def isActive(self):
        """
        Gets whether this occurrence is the active edit target in the user interface. This is the same as checking the state of the radio button next to the occurrence in the browser. To activate the occurrence use the Activate method.
        """
        return bool()
    @property
    def physicalProperties(self):
        """
        Returns the PhysicalProperties object that has properties for getting the area, density, mass, volume, moments, etc of this occurrence. Property values will be calulated using the 'LowCalculationAccuracy' setting when using this property to get the PhysicalProperties object. To specify a higher calculation tolerance, use the getPhysicalProperties method instead.
        """
        return PhysicalProperties()
    @property
    def isReferencedComponent(self):
        """
        Gets if this occurrence is referencing an external component.
        """
        return bool()
    @property
    def boundingBox(self):
        """
        Returns the bounding box of this occurrence.
        """
        return core.BoundingBox3D()
    @property
    def joints(self):
        """
        Returns the joints that affect the position of this occurrence. For example, if a joint has been created between this occurrence and another occurrence, this property will return that joint. If the occurrence is a proxy, the joints returned will also be proxies in the same context as the occurrence.
        """
        return JointList()
    @property
    def rigidGroups(self):
        """
        Returns the rigid groups that this occurrence is a member of. If the occurrence is a proxy, the joints returned will also be proxies in the same context as the occurrence.
        """
        return RigidGroupList()
    @property
    def asBuiltJoints(self):
        """
        Returns the as-built joints that affect the position of this occurrence. If the occurrence is a proxy, the as-built joints returned will also be proxies in the same context as the occurrence.
        """
        return AsBuiltJointList()
    @property
    def attributes(self):
        """
        Returns the collection of attributes associated with this face.
        """
        return core.Attributes()
    @property
    def bRepBodies(self):
        """
        Returns the body proxies for the B-Rep bodies in the component referenced by this occurrence. For example if you get the occurrences from the root component and then use this property to get the bodies from those occurrences, the bodies returned will return information in the context of the root component, not the component they actually exist in.
        """
        return BRepBodies()
    @property
    def visibleOpacity(self):
        """
        The user can set an override opacity for components and these opacity overrides combine if children and parent components have overrides. This property returns the actual opacity that is being used to render the occurence. To set the opacity use the opacity property of the Component object.
        """
        return float()

