class TrimFeatureInput(core.Base):
    """
    This class defines the methods and properties that pertain to the definition of a TrimFeatureInput.
    """
    def __init__(self):
        pass
    @staticmethod
    def cast(arg):
        return TrimFeatureInput()
    def cancel(self):
        """
        To determine the possible boundaries and allow you to choose which cells to keep, the trim
        feature does a partial compute when the input object is created. To do this it starts a trim
        feature transaction and completes the transaction when you call the add method. If you don't
        call the add method it leaves Fusion 360 in a bad state and there will be undo problems and it
        will possibly crash. If you have created a TrimFeatureInput object and don't want to finish
        the feature creation, you need to call the cancel method on the TrimFeatureInput object to
        safely abort the current trim feature transaction.
        """
        return bool()
    @property
    def bRepCells(self):
        """
        Returns the collection of the valid cells that have been calculated based on the trim tool. Use this collection to specify which cells to trim away.
        """
        return BRepCells()
    @property
    def trimTool(self):
        """
        Gets and sets the entity (a patch body, B-Rep face, construction plane or sketch curve) that intersects the trim tool
        """
        return core.Base()
    @trimTool.setter
    def trimTool(self, trimTool):
        """
        Gets and sets the entity (a patch body, B-Rep face, construction plane or sketch curve) that intersects the trim tool
        """
        pass
    @property
    def targetBaseFeature(self):
        """
        When creating a feature that is owned by a base feature, set this property to the base feature you want to associate the new feature with. By default, this is null, meaning it will not be associated with a base feature. Because of a current limitation, if you want to create a feature associated with a base feature, you must set this property AND call the startEdit method of the base feature, create the feature, and then call the finishEdit method of the base feature. The base feature must be in an 'edit' state to be able to add any additional items to it.
        """
        return BaseFeature()
    @targetBaseFeature.setter
    def targetBaseFeature(self, targetBaseFeature):
        """
        When creating a feature that is owned by a base feature, set this property to the base feature you want to associate the new feature with. By default, this is null, meaning it will not be associated with a base feature. Because of a current limitation, if you want to create a feature associated with a base feature, you must set this property AND call the startEdit method of the base feature, create the feature, and then call the finishEdit method of the base feature. The base feature must be in an 'edit' state to be able to add any additional items to it.
        """
        pass

